var minOperations = function(nums, target) {
    let sum = nums.reduce((acc, val) => acc + val, 0);
    if (sum < target) return -1;
    let count = Array(31).fill(0);
    nums.forEach(num => {
        count[Math.log2(num)]++;
    });
    let operations = 0, curTarget = target;
    for (let i = 30; i >= 0; i--) {
        let val = 1 << i;
        if (curTarget >= val) {
            let need = Math.min(count[i], Math.floor(curTarget / val));
            curTarget -= need * val;
            if (i > 0) count[i - 1] += 2 * need;
            operations += need;
        }
        if (curTarget === 0) break;
    }
    return curTarget === 0 ? operations : -1;
};
